import React, { useState } from 'react'

function HookCounter4() {
    const[items,setItems]= useState([])

    return (
        <div>
            <button>
                <ul>
                    {
                        items.map(item => <li key={item.id}>{item.value}</li>)
                    }
                </ul>
            </button>
        </div>
    )
}

export default HookCounter4
